// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

import {LibUnicornDNA} from "../libraries/LibUnicornDNA.sol";
import {LibDiamond} from "../libraries/LibDiamond.sol";
import {LibStats} from "../libraries/LibStats.sol";

contract StatsFacet {

    //  TODO: move _deriveStat into a library and convert all of these functions
    function getAttack(uint256 _dna) public view returns (uint256) {
        return _deriveStat(_dna, LibUnicornDNA.STAT_ATTACK);
    }

    function getAccuracy(uint256 _dna) public view returns (uint256) {
        return _deriveStat(_dna, LibUnicornDNA.STAT_ACCURACY);
    }

    function getMovementSpeed(uint256 _dna) public view returns (uint256) {
        return _deriveStat(_dna, LibUnicornDNA.STAT_MOVE_SPEED);
    }

    function getAttackSpeed(uint256 _dna) public view returns (uint256) {
        return _deriveStat(_dna, LibUnicornDNA.STAT_ATTACK_SPEED);
    }

    function getDefense(uint256 _dna) public view returns (uint256) {
        return _deriveStat(_dna, LibUnicornDNA.STAT_DEFENSE);
    }

    function getVitality(uint256 _dna) public view returns (uint256) {
        return _deriveStat(_dna, LibUnicornDNA.STAT_VITALITY);
    }

    function getResistance(uint256 _dna) public view returns (uint256) {
        return _deriveStat(_dna, LibUnicornDNA.STAT_RESISTANCE);
    }

    function getMagic(uint256 _dna) public view returns (uint256) {
        return _deriveStat(_dna, LibUnicornDNA.STAT_MAGIC);
    }

    function getUnicornMetadata(uint256 _tokenId)
        external
        view
        returns (
            bool origin,
            bool gameLocked,
            bool limitedEdition,
            uint256 lifecycleStage,
            uint256 breedingPoints,
            uint256 unicornClass,
            uint256 hatchBirthday
        )
    {
        LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
        uint256 dna = LibUnicornDNA._getDNA(_tokenId);
        LibUnicornDNA.enforceDNAVersionMatch(dna);
        origin = LibUnicornDNA._getOrigin(dna);
        gameLocked = LibUnicornDNA._getGameLocked(dna);
        limitedEdition = LibUnicornDNA._getLimitedEdition(dna);
        lifecycleStage = LibUnicornDNA._getLifecycleStage(dna);
        breedingPoints = LibUnicornDNA._getBreedingPoints(dna);
        unicornClass = LibUnicornDNA._getClass(dna);
        hatchBirthday = ds.hatch_birthday[_tokenId];
    }

    function getUnicornBodyParts(uint256 _dna)
        external
        view
        returns (
            uint256 bodyPartId,
            uint256 facePartId,
            uint256 hornPartId,
            uint256 hoovesPartId,
            uint256 manePartId,
            uint256 tailPartId,
            uint8 mythicCount
        )
    {
        LibUnicornDNA.enforceDNAVersionMatch(_dna);
        LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();

        uint8 classId = LibUnicornDNA._getClass(_dna);

        bodyPartId = ds.bodyPartGlobalIdFromLocalId[classId][1][
            LibUnicornDNA._getBodyPart(_dna)
        ];
        facePartId = ds.bodyPartGlobalIdFromLocalId[classId][2][
            LibUnicornDNA._getFacePart(_dna)
        ];
        hoovesPartId = ds.bodyPartGlobalIdFromLocalId[classId][4][
            LibUnicornDNA._getHoovesPart(_dna)
        ];
        hornPartId = ds.bodyPartGlobalIdFromLocalId[classId][3][
            LibUnicornDNA._getHornPart(_dna)
        ];
        manePartId = ds.bodyPartGlobalIdFromLocalId[classId][5][
            LibUnicornDNA._getManePart(_dna)
        ];
        tailPartId = ds.bodyPartGlobalIdFromLocalId[classId][6][
            LibUnicornDNA._getTailPart(_dna)
        ];

        if (ds.bodyPartIsMythic[bodyPartId]) ++mythicCount;
        if (ds.bodyPartIsMythic[facePartId]) ++mythicCount;
        if (ds.bodyPartIsMythic[hoovesPartId]) ++mythicCount;
        if (ds.bodyPartIsMythic[hornPartId]) ++mythicCount;
        if (ds.bodyPartIsMythic[manePartId]) ++mythicCount;
        if (ds.bodyPartIsMythic[tailPartId]) ++mythicCount;
    }

    function getUnicornBodyPartsLocal(uint256 _dna)
        external
        view
        returns (
            uint256 bodyPartLocalId,
            uint256 facePartLocalId,
            uint256 hornPartLocalId,
            uint256 hoovesPartLocalId,
            uint256 manePartLocalId,
            uint256 tailPartLocalId
        )
    {
        LibUnicornDNA.enforceDNAVersionMatch(_dna);
        bodyPartLocalId = LibUnicornDNA._getBodyPart(_dna);
        facePartLocalId = LibUnicornDNA._getFacePart(_dna);
        hoovesPartLocalId = LibUnicornDNA._getHoovesPart(_dna);
        hornPartLocalId = LibUnicornDNA._getHornPart(_dna);
        manePartLocalId = LibUnicornDNA._getManePart(_dna);
        tailPartLocalId = LibUnicornDNA._getTailPart(_dna);
    }

    function getStats(uint256 _dna)
        external
        view
        returns (
            uint256 attack,
            uint256 accuracy,
            uint256 movementSpeed,
            uint256 attackSpeed,
            uint256 defense,
            uint256 vitality,
            uint256 resistance,
            uint256 magic
        )
    {
        attack = getAttack(_dna);
        accuracy = getAccuracy(_dna);
        movementSpeed = getMovementSpeed(_dna);
        attackSpeed = getAttackSpeed(_dna);
        defense = getDefense(_dna);
        vitality = getVitality(_dna);
        resistance = getResistance(_dna);
        magic = getMagic(_dna);
    }

    function _deriveStat(uint256 _dna, uint256 _statId)
        internal
        view
        returns (uint256)
    {
        LibUnicornDNA.enforceDNAVersionMatch(_dna);
        require(
            LibUnicornDNA._getLifecycleStage(_dna) ==
                LibUnicornDNA.LIFECYCLE_ADULT ||
                LibUnicornDNA._getLifecycleStage(_dna) ==
                LibUnicornDNA.LIFECYCLE_BABY,
            "LibStats: Invalid DNA Lifecycle Stage, must be baby or adult"
        );

        LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
        uint256 class = LibUnicornDNA._getClass(_dna);
        uint256 statBase = ds.baseStats[class][_statId];

        if (
            LibUnicornDNA._getLifecycleStage(_dna) ==
            LibUnicornDNA.LIFECYCLE_ADULT
        ) {
            statBase += (statBase / 5); //  add 20%
        }

        uint256[] memory geneId = new uint256[](18);

        geneId[0] = LibUnicornDNA._getBodyMajorGene(_dna);
        geneId[1] = LibUnicornDNA._getBodyMidGene(_dna);
        geneId[2] = LibUnicornDNA._getBodyMinorGene(_dna);

        geneId[3] = LibUnicornDNA._getFaceMajorGene(_dna);
        geneId[4] = LibUnicornDNA._getFaceMidGene(_dna);
        geneId[5] = LibUnicornDNA._getFaceMinorGene(_dna);

        geneId[6] = LibUnicornDNA._getHoovesMajorGene(_dna);
        geneId[7] = LibUnicornDNA._getHoovesMidGene(_dna);
        geneId[8] = LibUnicornDNA._getHoovesMinorGene(_dna);

        geneId[9] = LibUnicornDNA._getHornMajorGene(_dna);
        geneId[10] = LibUnicornDNA._getHornMidGene(_dna);
        geneId[11] = LibUnicornDNA._getHornMinorGene(_dna);

        geneId[12] = LibUnicornDNA._getManeMajorGene(_dna);
        geneId[13] = LibUnicornDNA._getManeMidGene(_dna);
        geneId[14] = LibUnicornDNA._getManeMinorGene(_dna);

        geneId[15] = LibUnicornDNA._getTailMajorGene(_dna);
        geneId[16] = LibUnicornDNA._getTailMidGene(_dna);
        geneId[17] = LibUnicornDNA._getTailMinorGene(_dna);

        uint256 addition = 0;
        uint256 multiplier = 0;

        for (uint256 i = 0; i < 18; ++i) {
            for (uint256 j = 1; j <= 3; ++j) {
                if (ds.geneBonusStatByGeneId[geneId[i]][j] == _statId) {
                    if (ds.geneApplicationById[geneId[i]] == 1) {
                        multiplier += ds.geneBonusValueByGeneId[geneId[i]][j];
                    } else if (ds.geneApplicationById[geneId[i]] == 2) {
                        addition += ds.geneBonusValueByGeneId[geneId[i]][j];
                    }
                }
            }
        }

        uint256 stat = statBase + addition;
        stat += ((stat * multiplier) / 100);
        return (stat <= 1000) ? stat : 1000;
    }

    function getPowerScore(uint256 tokenId) public view returns (uint256) {
        uint256 dna = LibUnicornDNA._getDNA(tokenId);
        uint256 attack = getAttack(dna);
        uint256 accuracy = getAccuracy(dna);
        return LibStats.getPowerScore(attack, accuracy);
    }

    function getSpeedScore(uint256 tokenId) public view returns (uint256) {
        uint256 dna = LibUnicornDNA._getDNA(tokenId);
        uint256 movementSpeed = getMovementSpeed(dna);
        uint256 attackSpeed = getAttackSpeed(dna);
        return LibStats.getSpeedScore(movementSpeed, attackSpeed);
    }

    function getEnduranceScore(uint256 tokenId) public view returns (uint256) {
        uint256 dna = LibUnicornDNA._getDNA(tokenId);
        uint256 vitality = getVitality(dna);
        uint256 defense = getDefense(dna);
        return LibStats.getEnduranceScore(vitality, defense);
    }

    function getIntelligenceScore(uint256 tokenId) public view returns (uint256) {
        uint256 dna = LibUnicornDNA._getDNA(tokenId);
        uint256 magic = getMagic(dna);
        uint256 resistance = getResistance(dna);
        return LibStats.getIntelligenceScore(magic, resistance);
    }
}
